    false,nt"url": null,nt"notes": "During the breeding season in 2001, the
    seaside sparrow population was surveyed in different fire treatment areas of Mallard
    Slough Marsh at St. Vincent NWR.  The objective of the project was to survey for
    singing male seaside sparrows along an already established experimental study plot.
     It was observed that seaside sparrows used particular sites more than others and
    researchers are interested in determining if a similar pattern is evident in a follow-up
    second year study.",nt"license_title": "License Not Specified",nt"extras":
